import React from "react";
import {FacebookFilled,InstagramOutlined } from '@ant-design/icons';
const SocialFollow = () =>{
    return(
        <>
         <div id="contact-us-flag">
			<a href="https://acclaimedhw.com/contact-us/" class="desktop" title="">
				<img src="https://acclaimedhw.com/wp-content/themes/acclaimed-hw-2018/img/contact-us-vertical.png" alt=""></img>
			</a>
			<a href="https://www.facebook.com/acclaimedhomewarranty/" target="_blank" title="">
				<i class="achi facebook"></i>
				<i class="achi facebook-blue"></i>
			</a>
			<a href="https://www.instagram.com/acclaimedhwslc/?hl=en" target="_blank" title="">
				<i class="achi instagram"></i>
				<i class="achi instagram-blue"></i>
			</a>
		</div>
        </>
    ) 
};
export default SocialFollow;
